import React from "react";
import AboutCard from "./AboutCard";

const About = () => {
  return (
    <>
      <section className="about top">
        <div className="container">
          <AboutCard />
        </div>
      </section>

      <section className="features top">
      <div className="container">

      </div>
      </section>
    </>
  );
};

export default About;
